import React, {useState} from 'react';
import './App.css';
import TaskItem from './components/TaskItem';

function App() {
  const [tasks, setTasks] = useState([
    {time: "08:00", title: "Lick slicker finger"},
    {time: "10:00", title: "Start watch film"},
    {time: "18:30", title: "Disturp USSR"}
  ]);

  return (
    <div className="App">
      <div className="Body">
        <h1>TODO</h1>

        <hr className="Main-line"/>

        <div className="Bottoms">
          <button className="Bottoms__create">+</button>
        </div>

        <div className="Tasks">
          {tasks.map((task) => 
            <TaskItem time={task.time} title={task.title} key={Date.now}/>
          )}
        </div>
      </div>
    </div>
  );
}

export default App;
